@import url("https://fonts.googleapis.com/css?family=Playfair+Display:400,700,900");

@import url("https://fonts.googleapis.com/css?family=Lato:100,300,400");

/* --------- GENERAL ---------- */

* {
  margin: 0;
  padding: 0;
}

:root {
  scroll-behavior: smooth;
}

body {
  margin: 0;
}

h1 {
  font-family: "Lato", sans-serif;
  font-size: 13px;
  text-align: center;
  margin: 0 auto;
  text-align: center;
  margin-top: 120px;
  font-size: 30px;
  margin-bottom: 30px;
}

h2 {
