  padding: 0px;
  text-align: center;
  margin: 0 auto;
  letter-spacing: 4px;
  font-weight: 300;
  color: dimgray;
}

h3 {
  font-family: "Lato", sans-serif;
  font-weight: 400;
  letter-spacing: 4px;
}

h4 {
  font-family: "Lato", sans-serif;
  font-weight: 200;
  line-height: 0.8;
  font-size: 1.1em;
  cursor: default;
}

p {
  font-family: "Playfair Display", serif;
  text-align: center;
  margin: 0 auto;
  font-size: 15px;
  line-height: 2.5;
}

.hr {
  margin: 80px 200px auto;
}

/* ---- NAV ----- */

.topnav {
  list-style-type: none;
  margin: 0;
  padding: 0;
  overflow: hidden;
  /* ---- covers content ----- */
  background-color: white;
  opacity: 0.9;
  position: fixed;
  width: 100%;
  top: 0;
  z-index: 3;
}

.topnav a {
  float: left;
  display: block;
  text-align: center;
  padding: 12px 28px;
  /* ---- covers content ----- */
  text-decoration: none;
  font-size: 13px;
  text-transform: uppercase;
  color: dimgray;
  opacity: inherit;
  font-family: "Lato", sans-serif;
  font-weight: 300;
  letter-spacing: 2px;
}

.topnav .icon {
  display: none;
}

.active,
.btn:hover {
  background-color: #ddd;
}

/* --------- HERO SECTION ---------- */

section#hero {
  background-image: url(img/large/background3.jpg);
  width: 100%;
  text-align: center;
  height: 750px;
  background-size: cover;
  position: relative;
  background-position: center;
}

#logo {
  max-width: 170px;
}

section#hero img {
  margin-top: 250px;
}

#see_more {
  position: absolute;
  bottom: 50px;
  font-family: sans-serif;
  background-color: inherit;
  color: white;
  left: 50%;
  padding: 10px;
  margin-left: -53px;
  transform: 0.5;
  letter-spacing: 1px;
  transition: 0.3s ease;
}

#see_more:hover {
  background-color: white;
  color: black;
  cursor: pointer;
  transform: scale(1.1);
}

@keyframes jump {
  0% {
    transform: translate3d(0, 0, 0) scale3d(1, 1, 1);
  }

  100% {
    transform: translate3d(0, 50%, 0) scale3d(1, 0.9, 1);
  }
}

/* --------- ARROW ---------- */

.jump {
  transform-origin: 50% 50%;
  position: absolute;
  padding: 11px;
  animation: jump 0.5s linear alternate infinite;
  bottom: 20px;
  left: 50%;
  width: 15px;
}

/* --------- PORTFOLIO SECTION ---------- */

section#portfolio {
  text-align: center;
  padding: 1px 0;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: 100px 100px 1fr 1fr 1fr;
  height: auto;
}

#portfolio hr {
  grid-row: 1;
}

#portfolio h2 {
  grid-row: 2;
}

.video_ux,
.animation_website,
.website_others {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-template-rows: auto;
  margin-left: 10vw;
