.port_project {
  -webkit-transition: all 0.9s;
  -moz-transition: all 0.9s;
  -ms-transition: all 0.9s;
  transition: all 0.9s;
  position: relative;
}

.port_project::after {
  position: absolute;
  content: "";
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.4);
  transition: 0.5s;
}

.port_project:hover::after {
  background: rgba(0, 0, 0, 0.1);
}

